import React from "react";
import "./Pages.css";

const Contact = () => {
  return (
    <div className="page">
      <h2>Contact</h2>
      <p>If you have any questions, feel free to reach us at:</p>
      <ul>
        <li>Email: support@blogapp.com</li>
        <li>Phone: +91 9319428985</li>
      </ul>
    </div>
  );
};

export default Contact;
